import React from "react";
import { Container, CardHeader, Col, Row, FormGroup, Card } from "shards-react";
import formItems from "../../data/form-items";

export default function FormItemCatalogue() {
  return (
    <Container fluid>
      {/* <Row> */}
        <Col
          className="bg-white border-1 mr-3 p-0 border card"
          style={{ boxShadow: "none", maxWidth: "309px" }}
        >
          <div className="p-0 border-bottom">
            <CardHeader className="p-3">
              <h5 className="m-0">Question Banks</h5>
            </CardHeader>
          </div>

          <Col
            style={{ overflowY: "auto", overflowX: "none" }}
            className="p-0"
          >
            {formItems.map((item, i) => {
              return (
                <FormGroup
                  className={`${i !== formItems.length - 1 &&
                    "border-bottom"} p-3 m-0 cursor-pointer form-item`}
                >
                  <label className="text-muted d-block mb-2" style={{fontSize: ".9rem"}}>
                    {item.title}
                  </label>
                  <item.component
                    type={item.type}
                    options={item.options}
                    disabled
                    key={`item-${i + 1}`}
                    className="bg-white cursor-pointer"
                  />
                </FormGroup>
              );
            })}
          </Col>
        </Col>
      {/* </Row> */}
    </Container>
  );
}
